import React from 'react';
import './Footer.css';

const Footer = () => {
  const socialLinks = [
    {
      name: 'GitHub',
      icon: 'ðŸ™',
      url: 'https://github.com/siddhantukhani',
      color: '#333'
    },
    {
      name: 'LinkedIn',
      icon: 'ðŸ’¼',
      url: 'https://www.linkedin.com/in/siddhantukhani/',
      color: '#0077b5'
    },
    {
      name: 'Email',
      icon: 'ðŸ“§',
      url: 'mailto:sukhani@stanford.edu',
      color: '#ea4335'
    },
    {
      name: 'Research',
      icon: 'ðŸ“Š',
      url: '#',
      color: '#667eea'
    }
  ];

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="container">
          <div className="footer-main">
            <div className="footer-brand">
              <h3>Siddhant Sukhani</h3>
              <p>Computational mathematician creating innovative solutions at the intersection of ML and finance</p>
            </div>

            <div className="footer-links">
              <div className="footer-section">
                <h4>Quick Links</h4>
                <ul>
                  <li><button onClick={() => document.getElementById('home').scrollIntoView({ behavior: 'smooth' })}>Home</button></li>
                  <li><button onClick={() => document.getElementById('about').scrollIntoView({ behavior: 'smooth' })}>About</button></li>
                  <li><button onClick={() => document.getElementById('projects').scrollIntoView({ behavior: 'smooth' })}>Research</button></li>
                  <li><button onClick={() => document.getElementById('contact').scrollIntoView({ behavior: 'smooth' })}>Contact</button></li>
                </ul>
              </div>

              <div className="footer-section">
                <h4>Expertise</h4>
                <ul>
                  <li>Machine Learning</li>
                  <li>Quantitative Finance</li>
                  <li>Mathematical Modeling</li>
                  <li>NLP Research</li>
                </ul>
              </div>

              <div className="footer-section">
                <h4>Connect</h4>
                <div className="social-links">
                  {socialLinks.map((link, index) => (
                    <a 
                      key={index}
                      href={link.url}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="social-link"
                      style={{ '--social-color': link.color }}
                      title={link.name}
                    >
                      <span className="social-icon">{link.icon}</span>
                    </a>
                  ))}
                </div>
              </div>
            </div>
          </div>

          <div className="footer-bottom">
            <div className="footer-copyright">
              <p>&copy; 2024 Siddhant Sukhani. All rights reserved.</p>
            </div>
            <button onClick={scrollToTop} className="back-to-top">
              <span>â†‘</span>
              <span>Back to Top</span>
            </button>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
